import React from "react"

function UserPlaylist(props) {
    const artistList = props.finalPlaylist.map((artist) => {
        return (<p>{artist}...</p>)
    })

    return (
        <>
            <hr />
            <h3>Adding songs from:</h3>
            {artistList}
            <div className="progressBar"></div>
        </>
    )
}

export default UserPlaylist
